import logo from './logo.svg';
import './App.css';

function App() {
  const testData = [
    {
      "id":1,
      "english":"Hello!",
      "chinese":"你好！",
      "pinyin":"nǐhǎo!"
    },
    {
      "id":2,
      "english":"You",
      "chinese":"你",
      "pinyin":"nǐ"
    }
  ];
  return (
    <div className="App">
      <header className="App-header">Learn Chinese!</header>
      <div className="LessonContent">
        <table>
          <th>English</th>
          <th>Pinyin</th>
          <th>Chinese</th>
          <tr> 
            <td className="English">{testData.english[0]}</td>
            <td className="Pinyin">{testData.pinyin}</td>
            <td className="Chinese">{testData.chinese}</td>
          </tr>
        </table>
      </div>
    </div>
  );
}

export default App;
